window.bookSummaryJSON = "<p><b>Zachary Olson</b></p> <p>I screwed up. Big time. I hurt someone, and I hate myself for it.</p> <p>I'm barely eighteen and already completely exhausted. Tired of being haunted by secrets and guilt.</p> <p>My biggest regret, though, is keeping it all from Adam—my best friend, teammate, protector. My everything since I can remember.</p> <p>And how do I repay him? By keeping these secrets locked up inside. Secrets I know would destroy us.</p> <p>But I'm not sure how much longer I can do it. No matter how catastrophic the consequences.</p> <p><b>Adam Bates</b></p> <p>He won't talk to me.</p> <p>He's never kept secrets from me before. We're both quiet guys who keep to ourselves. But that's never applied to each other.</p> <p>I know something is wrong, but my best friend has shut me out.</p> <p>How can I keep him safe if he won't talk to me?</p> <p>All my life, I've taken on this role—doing what's right, no matter what. Watching out for everyone, on and off the field—especially Zach.</p> <p>And I won't fail him now when he needs me more than ever.</p> <p>Because this is who I am and what I do...</p> <p>I'm the protector.</p>"; 
